import React from 'react';

const Rank = (prop) => {
	const {name , entries} = prop;
	return(

		<div>
			<div className = 'f3 white'>
				{`${name} your current rank is #${entries}`}
			</div>
			<div className = 'f1 white'>
				{'#7'}
			</div>

		</div>
	);
}

export default Rank;
